window.bookSummaryJSON = "<p>When a huge alien spacecraft crashes on the island of Cuba, the world scrambles to investigate. Secretive organizations have waited for generations for this opportunity, and they do not hesitate to send in recovery teams. Cooperation between nations breaks down as every government wants the newly discovered technology for themselves. Naturally, the Cubans have beaten everyone else, and the island is beginning to change. Aircraft flying reconnaissance are swatted from the skies. Commandos can’t make a landing on the beaches without being annihilated. Malena Marin is a new XCU agent with special abilities. She’s sent with a team of veterans on a mission to secure the landing site or die trying. Unfortunately, the enemy knows they’re coming. As the conflict grows and turns increasingly violent, the aliens themselves enter the game. And they have plans of their own....</p>"; 
